import React from 'react';
import Table from "react-bootstrap/Table";
import ItemTableWalletCurrency from "./ItemTableWalletCurrency";

const TableWalletCurrency = ({currency}) => {
    console.log(currency)
    return (
        <Table borderless striped responsive="sm" >
            <thead >
            <tr >
                <th >#</th >
                <th >Name</th >
                <th >Price</th >
                <th >Count</th >
                <th >Summary</th >
                <th ></th >
            </tr >
            </thead >
            <tbody >
            {currency.map((item, index) =>
                <ItemTableWalletCurrency key={item.id} currency={item} index />)
            }
            </tbody >
        </Table >

    )
};

export default TableWalletCurrency;
